 import "./style.css";
 
 const App =()=>{
    let count =0;
    const increment=()=>{
        count++;
    }
    return (
        <div id="container">
            <button onClick={increment}>click</button>
            <h1>{count}</h1>
            </div>
    )
};
export default App;
